import React from "react";

const Statewise = () => {
  return (
    <>
      <h1>SPD</h1>
      <button type="button" class="btn btn-primary">
        Primary
      </button>
      <div class="card">
        <div class="card-body">This is some text within a card body.</div>
      </div>
    </>
  );
};
export default Statewise;
